import { Link } from "react-router-dom";

function CharacterItem(props) {
  return (
    <Link to={`./user/${props.data.id}`}>
      <div className="container__card">
        <img
          className="card__img"
          src={props.data.image}
          alt={`foto de ${props.data.name}`}
          title={`foto de ${props.data.name}`}
        />
        <h4 className="card__name">{props.data.name}</h4>
        <p className="card__species">
          {" "}
          {props.data.species}
          {props.data.species === "Human" ? (
            <i class="fas fa-user-astronaut" id="icon-detail-landing"></i>
          ) : (
            <span
              className="iconify"
              data-icon="ri:aliens-fill"
              id="icon-detail-landing"
            ></span>
          )}
        </p>
      </div>
    </Link>
  );
}

export default CharacterItem;
